import React from 'react'

function Message(props) {
    return (
        <div>
            {
            props.data.userId === props.myId
             ?
                <div className="wdth_100prc float_right">
                    <div className="chat-msg chat-msg_right float_right">
                        RIGHT{props.data.msg}
                    </div>
                </div>
             :
                <div className="wdth_100prc float_left">
                    <div className="chat-msg chat-msg_left float_left">
                        LEFT{props.data.msg}
                    </div>
                </div>
            }
        </div>
    )
}

export default Message
